description:
Black Rogue Cops

Even the rich have their problems. Officers Wright and Rock answer a marital dispute call.

Socialite heiress Hilton gets examined in every hole imaginable!

Help me officer, I hear a noise... Desperate housewife Mya cries out for attention... and she gets it!

What better way to break a lady cop... A DP and a gang bang!

Yes, Beverly Hills' does have hos. Officer Wright goes undercover deep in Ricki's ass!

Starring:LT, Bobbi Star, Brianna Love, Ricki White, Maya Gates, C.J. Wright, Rock, Domineko, Maria Bellucci, Emily Evermoore, Miss Lady, Big Sid, Miss White


